import React from "react";

const ItemList = ({ items }) => {
  return (
    <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
      {items.map((item) => (
        <div key={item.id} className="border p-4 rounded-lg shadow-lg bg-white hover:shadow-xl transition-all">
          <img
            src={`https://via.placeholder.com/150?text=${item.category}`}
            alt={item.category}
            className="w-full h-40 object-cover rounded-md"
          />
          <div className="mt-4">
            <h3 className="text-lg font-semibold text-gray-800">{item.designer}</h3>
            <p className="text-sm text-gray-600">{item.category}</p>
            <p className="text-xl font-bold text-gray-900">${item.price}</p>

            <div className="flex items-center space-x-1 mt-2">
              {[...Array(5)].map((_, index) => (
                <svg
                  key={index}
                  xmlns="http://www.w3.org/2000/svg"
                  fill={index < item.rating ? "yellow" : "gray"}
                  className="w-5 h-5"
                  viewBox="0 0 20 20"
                  stroke="currentColor"
                  aria-hidden="true"
                >
                  <path
                    fillRule="evenodd"
                    d="M10 15l-3.09 1.636L7.5 12 4 8.364l4.09-.364L10 2l1.91 5.636L16 8.364l-3.5 4l.59 4.636L10 15z"
                    clipRule="evenodd"
                  />
                </svg>
              ))}
            </div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default ItemList;
